import Store, { Context } from './Store.js'
import Info from './Info.js'
import AllPlayers from './AllPlayers.js'
import Center from './Center.js'
import './App.css';


function App() {

  const state = useContext(Context);

  return (
    <Store >
      <div id='app-container'>
        <Info />
        <AllPlayers />
        <Center />
      </div>
    </Store>
  );
}

export default App;
